import React, { Component } from 'react';
import Todo from './Todo';

class TodoList extends Component {
  render() {
    const { todos, toggleTodo } = this.props;
    return (
      <ul>
        {todos.map(todo => {
          return (
            <Todo
              key={todo.id}
              {...todo}
              onClick={() => {
                toggleTodo(todo.id);
              }}
            />
          );
        })}
      </ul>
    );
  }
}

export default TodoList;
